import React from 'react';
import './MenuList.css';
import menuItems from './MenuItems';


class MenuList extends React.Component {

    render() {
        return (
            <div>
                {
                    menuItems[this.props.category].items.map(item => {
                        console.log(item);
                        return <p>{item.name}</p>
                    })
                }
            </div>
        )
    }
}

export default MenuList;
